			cX:77.329649747836,
			cY:-67.528900329643,
			ct:" NASA/CXC/Rutgers/J.Warren, J.Hughes. A Chandra X-ray Observatory image of the supernova remnant SNR 0509-67.5 in the Large Magellanic Cloud. The lowest energy X-rays are shown in red, the intermediate energies are green and the highest energies are blue. In 2004, scientists used Chandra to show that SNR 0509-67.5 was likely caused by a Type Ia supernova, using an analysis of the elements, such as silicon and iron, that were detected. A Type Ia is thought to result from a white dwarf star in a binary system that reaches a critical mass and explodes. In the new X-ray study of SNR 0509-67.5, spectra from Chandra and ESA's XMM-Newton Observatory were used to calculate the amount of energy involved in the original explosion, using an analysis of the supernova remnant and state-of-the-art explosion models.",
